import React, { Fragment } from 'react'
import CountUp, { CountUpMoleculeProps } from 'ui/molecule/countUp'

export type CountUpTemplateProps = CountUpMoleculeProps & {}

export default (props: CountUpTemplateProps) => {
    return (
        <Fragment>
            <CountUp {...props} />
        </Fragment>
    )
}
